:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Samuel and WILLIAMS, Mary
  JWILLIAMS, Lucy Frances and WARREN, Thomas John Cory (Jack)
  JWARREN, Greville Williams and WRIGHT, Norah de Vesci
  LWARREN, Geoffrey John and NATION, Dinah Gladys
  01> WARREN, Geoffrey John m on 20.06.1953 to NATION, Dinah Gladys
  b 27.08.1927 d 21.08.1986
  b 21.03.1931
  Geoffrey b. and m. at Hastings, d. at Tauranga and bd, at Pukehou Cemetery. Dinah, d/o Esdaile Chilcott
  (Short) Nation and Mavis McHardy, b. at Hastings. Contact address: Joyce Road, RD 3, Tauranga.
  Geoffrey was educated at Hereworth School, Wanganui Collegiate School and Lincoln College (DipAg 1951)
  and became a farmer. He set up and managed "Kahotea" farm (the rear block of "Penlee" station) for the
  H and M McBain Family Trust from 1953 to 1961. He then purchased and ran "Penlee" station until it was
  sold in 1981. Geoff was a Board member of the Henry and William Williams Trust, and had an integral
  part in the setting up and management of "Pahia" and "Puketona", two of the Trust's farms. Geoff was a
  keen sportsman with particular interest in water and snow skiing, shooting and yachting. He was also a
  member of the NZ Territorial Army where he achieved the rank of Captain. He was a keen member of Rotary
  International in both Waipawa and Tauranga.
  Dinah was educated at Woodford House and is an active recreational sportswoman. After spending three
  years at Katafaga, Lau Group, Fiji, where she managed a plantation and the conservation of the island,
  she returned to Tauranga where she now lives. She is a keen gardener, and enjoys tramping, tennis,
  golf and skiing.
  01> WARREN, Andrew Geoffrey Fiennes m on 22.12.1979 to SAATHOF, Alice
  b 22.06.1954
  b 13.02.1958
  Andrew b. and m. at Hastings. Alice, d/o Jacob Saathof and Jeanette de Kater, of Havelock North.
  Address: 433 Joyce Road, Pyes Pa, RD 3, Tauranga; email: andy@bloomz.co.nz.
  Andy was educated at Hereworth School, Wanganui Collegiate and Massey
  University. He graduated BAgSc( Hons) in 1977, and was awarded a Junior University Postgraduate
  Scholarship. He went to the Solomon Islands on VSA (Volunteer Service Abroad) in 1973.
  After graduation Andy was employed as an agricultural consultant based in London and on his return
  to New Zealand he farmed "Penlee" for two years prior to its sale in 1981. Andy and Alice moved to
  Tauranga and after a short period in kiwifruit, established a floricultural export company, BLOOMZ.
  A joint venture with a major Japanese trading company was set up in 1991 and the company has grown
  steadily since, with an increasing emphasis on international trading. Andy and Alice diversified
  in 1997 with an active share in a new company, Novozone, which manufactures and distributes ozone
  generation equipment. Andy enjoys skiing, boating and game fishing.
  Alice was educated at Hastings Girls' High School and graduated from Palmerston North Teachers'
  College in 1978 with a Teacher Training Certificate. She has been a full time parent to four
  children for the past 15 years and will complete the last paper of a BEd(Massey) degree majoring in
  linguistics in 1998. Alice is a keen and active sportswoman, enjoying skiing, tennis and golf.
  01> WARREN, Marcus Daniel
  b 16.01.1983
  Marcus b. at Tauranga. He was a Bay of Plenty U13 rugby rep and is currently at Kings College,
  Auckland.
